import React from 'react';
import './Header.css';

const Header = () => {
  return (
    <header className="header">
      <div className="header__logo">
         <img src="/logo.png" alt="Logo du site" />
      </div>
      <div className="header__auth">
         <button>Connexion</button>
      </div>
    </header>
  );
};

export default Header;
